script: |
  super -f text -I q3605.spq | sort > q3605.out

inputs:
  - name: q3605.spq
    data: |
      SELECT ALL 4 * col2 AS col0 FROM tab2 (FORMAT parquet) WHERE - - 32 NOT BETWEEN - col0 AND - + col2 + - + 2;
  - name: tab2

outputs:
  - name: q3605.out
    data: |
      160
      232
      92
